import React , {useState,useEffect}from 'react'
import { Link } from 'react-router-dom'

function Uyeler() {

    const [uyeler,setUyeler] = useState([])

    useEffect(() => {
        uyeGetir()
    },[])

    const uyeGetir = async () => {
        let datas = await fetch('https://jsonplaceholder.typicode.com/users');
        let uye = await datas.json(datas);
        setUyeler(uye)
    }
    
    const myStil = {
        display : 'flex',
        fontWeight : 'bold'
    }

    return (
        <div>
            {uyeler.map((uye) => (
                <Link to={`/uyeler/${uye.id}`} style={myStil}>
                    <h3 key={uye.id}>{uye.name}</h3>
                </Link>
            ))}
        </div>
    )
}

export default Uyeler
